import React from 'react'
import {
  Typography,
  Avatar,
  Grid,
  Box
} from "@material-ui/core";
import avatar from "../avatar.png";
import Typed from "typed.js";

const Header = () => {
  const el = useRef(null);
  return (
    <>
      <Box>
        <Avatar src={avatar} alt="akhila"/>
        <Typography variant="h4">

        </Typography>
      </Box>
    </>
  )
}

export default Header;
